import React from "react";
import { motion } from "framer-motion";
import "../HomeScreen/HomeScreen.css";

function Backdrop() {
  return (
    <motion.div
      initial={{ opacity: 1, zIndex: 5 }}
      animate={{
        opacity: 0,
        zIndex: 0,
        transition: { duration: 0.5, delay: 5 },
      }}
      className="backdrop"
    >
      <motion.h1
        initial={{ scale: 1, opacity: 0 }}
        animate={{
          textShadow: "#e05a5a",
          opacity: 1,
          scale: 8,
          transition: {
            duration: 2,
            boxShadow: {
              duration: 2,
            },
          },
        }}
      >
        Ani<strong>My</strong>Site
      </motion.h1>
    </motion.div>
  );
}

export default Backdrop;
